import { Box } from '@material-ui/core';
import React, { useEffect, useState } from 'react'
import Icon from '../img/Icon.png'
import styled from 'styled-components'
import { useHistory } from 'react-router';
import axios from 'axios';



const BackgroundLogin = styled.div`
background-color: #292929;
height:100vh;
`
const ImageLogin = styled.img`
background-color: transparent;
width:128px;
padding-bottom: 36px;
`
const InputLogin = styled.input`
height: 56px;
width: 339px;
border-radius: 18px;
border: 0 none;
outline:0;
padding-top: 8px;
font-size: 23px;
font-family:Verdana, Geneva, Tahoma, sans-serif;

::-webkit-input-placeholder{
    font-size: 23px;
    padding-left: 15px;
    font-family:Verdana, Geneva, Tahoma, sans-serif;
    color: #535353;

}
`
const ButtonEnter= styled.button`
height: 56px;
width: 339px;
background-color: #FFCE00;
border-radius: 16px;
border: none;
margin-top: 20px;
display: flex;
justify-content: center;
align-items: center;

`
const TextButton = styled.p`
font-size: 18pt;
color:#030202;
font-family:Verdana, Geneva, Tahoma, sans-serif;
`
const IconButton = styled.img`
width: 30px;
height: 26px;
padding-left: 8px;
`


function LoginPage(props) {
    const [valueInput, setValueInput] = useState()
 
   
const history = useHistory()
  
    
    

    
    
const submitProps = (value) => {
    props.info.setConfirm(value)
    history.push('/home')

}



const handleInput = (e) => {
setValueInput(e.target.value)
}



    return (
        <BackgroundLogin>
            <Box display = 'flex' justifyContent = 'center' flexDirection = 'column'
             alignItems = 'center' paddingTop = '250px'>
                <Box width = '50px' margin = 'auto' marginRight = '200px'>
                    <ImageLogin src ={Icon}>

                    </ImageLogin>
                    </Box>

                        <Box>
                        <InputLogin
                        placeholder = 'UsuÃ¡rio'
                        required= 'true'
                        value = {valueInput}
                        onChange = {handleInput}
                        ></InputLogin>
                            </Box>

                            <Box>
                        <ButtonEnter onClick = {() => submitProps(valueInput)}>
                    <TextButton>Entrar</TextButton>
                    <IconButton src = 'https://cdn4.iconfinder.com/data/icons/feather/24/arrow-right-512.png'></IconButton>
                        </ButtonEnter>
                        </Box>
                    <div>
                </div>
            </Box>
        </BackgroundLogin>
    );
}

export default LoginPage;
